import React, { useState, useEffect } from "react";

const CanOpener = () => {
    const [participants, setParticipants] = useState([{ name: "" }]);
    return (
        <div>
            <form>
                {participants.map((value, index) => {
                    const participantId = `name-${index}`;
                    return (
                        <div key={`user-${index}`}>
                            <label htmlFor={participantId}>{`User #${
                                index + 1
                            }`}</label>
                            <input
                                type="text"
                                name={participantId}
                                data-index={index}
                                id={participantId}
                                className="nickName"
                            ></input>
                        </div>
                    );
                })}

                <input type="submit" value="Submit" />
            </form>
        </div>
    );
};
export default CanOpener;
